import React from 'react';

const CricketPage = () => (
  <div style={{ backgroundColor: 'black', color: 'white', minHeight: '100vh', padding: '20px' }}>
    <h1>Cricket</h1>
    <p>
      <img 
        src="/images/Cricket.jpg" 
        alt="Cricket" 
        width="500vh" 
        height="140vh" 
        style={{ 
          float: 'right', 
          border: '2px dotted black', 
          margin: '0 25px 15px 0' 
        }} 
      />
      <h3> In the paragraph below, the image will float to the right. A dotted black border is added to the image. 
      We have also added margins to the image to push the text away from the image:
      0 px margin on the top and right side, 15 px margin on the bottom, and 20 px margin on the left side of the image.</h3>
     
    </p>
  </div>
);

export default CricketPage;
